import React from 'react';


  
const Customer = () => {
 
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'Right',
        alignItems: 'Right',
        height: '100vh',
        width:'500px'
      }}
    >
      <h1>Welcome to customer page</h1>
    </div>
  );
};
  
export default Customer;
